import React from 'react';
import classes from './Vision.module.css';

function Vision() {
  return (
    <section className={classes.vision}>
      <h2>Vision 2030</h2>
      <p>At AM/NS India, we are committed to supporting our employees to realize their potential and grow in a truly global environment.</p>
    </section>
  );
}

export default Vision;
